import { instance } from "../services"

export const getDataMenu = async() => {
    const response = await instance.get('https://www.soldout.co.kr/api/v3/search/get-item-list?&typeGb=goods&pageIndex?&pageSize=50&keyword=jordan')
    const data = response.data.data.product_info.list.map(
        (item) => ({
            code: item.model_no,
            type: item.brand_name_eng,
            img: item.image_path,
        })
    )


    return data
}
